                        },
                        new
                        {
                            Id = new Guid("6dfd3998-4945-5305-b856-7dd4f008b727"),
                            Description = "The amount of mana used per pulse can be regulated with a maximum of 5000 mana per pulse. You may charge each pulse with 5000 mana per second to a maximum of 25000 mana. Once cosmic power resides within a target, you can rip it out with a reversed motion to cause additional damage. Cosmic power within a target stacks, depending on their defensive measures and structure.",
                            SkillId = new Guid("d3cad15f-3531-d853-ac13-22e7a0dd4f58"),
