                        },
                        new
                        {
                            Id = new Guid("c9d82084-ab60-5935-b280-c88e5ceed4a1"),
                            Description = "You may choose to use Cosmic Deconstruction as a non intrusive attack, instead sending out a broad wave of deconstructing energy from you at the center. The same motion requirements as in the first tier apply. If used as a wave, the range of Cosmic Deconstruction is equal to the range of your domain and is more effective against magical constructs.",
