                            Tier = 1
                        },
                        new
                        {
                            Id = new Guid("a757170d-e3cf-f018-8ef0-9bd22e076fc3"),
                            Description = "Your control is increased greatly, you can now focus your healing on specific parts of the body. As long as mana and health remains, your True Reconstruction will restore your body. Lose your head and see for yourself! Health loss and critical blows are recalculated due to the nature of your healing. You may restore magical constructs and enchantments with True Reconstruction.",
